  \"2015-01-22T15:57:45.822565\",\n\t\"name\": \"hud-gis-boundary-files\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The HUD GIS Boundary Files are intended
  to supplement boundary files available from the U.S. Census Bureau. The files are
  for community planners interested in working with census tract and block group data
  that splits by jurisdiction boundaries (summary levels 080, 090, and 091). The GIS
  shape files are most helpful when linked with census tract and block group data
  downloaded from the census standard tabulation data, CDBG low/mod area data (summary
  level 090), or the CHAS 2000 data (summary levels 080 and 091).\",\n\t\"license_title\":
